e=5F7C131D";}i:151;a:1:{s:4:"type";s:5:"image";}i:152;a:1:{s:8:"owner_id";i:9035877681;}i:153;a:1:{s:14:"owner_username";s:0:"";}i:154;a:1:{s:14:"owner_fullname";s:0:"";}i:155;a:1:{s:9:"owner_pic";s:0:"";}i:156;a:1:{s:2:"id";s:19:"2391175228190584889";}i:157;a:1:{s:10:"short_code";s:11:"CEvKTN4A3A5";}i:158;a:1:{s:12:"created_time";i:1599270321;}i:159;a:1:{s:7:"caption";s:1281:"Indonesia tidak akan menjadi pangkalan militer negara mana pun, termasuk Tiongkok atau Amerika Serikat (AS). Hal itu ditegas­kan Menteri Luar Negeri, Retno Mar­sudi dalam press briefing Kementerian Luar Negeri, di Jakarta, Jumat (4/9).

“Secara tegas saya ingin menekan­kan bahwa sesuai dengan garis dan prinsip politik luar negeri Indonesia, maka wilayah Indonesia tidak dapat dan tidak akan dijadikan basis atau pangkalan maupun fasilitas militer bagi negara manapun,” kata Retno.

Retno menegaskan sikap Indone­sia itu terkait laporan tahunan dari Departemen Pertahanan Amerika Serikat atau Pentagon. Pentagon me­nyebut Tiongkok tengah mempertim­bangkan membangun fasilitas jaring­an logistik di kawasan Asia dan Afrika.

Dalam laporan berjudul “Military and Security Developments Involv­ing The People’s Republic of China 2020” yang disampaikan pada Sela­sa (1/9) waktu setempat itu, Tiong­kok menargetkan sejumlah negara di dunia termasuk Indonesia sebagai tempat membangun pangkalan mili­ter AS. Beberapa negara yang diincar Tiongkok adalah Myanmar, Thailand, Singapura, Sri Lanka, Pakistan, Uni Emirat Arab, Kenya, Syecelles, Tanza­nia, Angola, dan Tajikistan.
